import React from 'react'
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import LandingPage from './components/LandingPage/LandingPage'
import {BrowserRouter, Switch, Route} from 'react-router-dom'
import Holdings from './components/Holdings/Holdings'
import HomeBar from './components/HomeBar/HomeBar'
import TopBar from './components/HomeBar/TopBar'
import ContactUs from './components/Account/ContactUs'
import MakeMoney from './components/LandingPage/MakeMoney'
import FAQs from './components/LandingPage/FAQs'
import GettingStarted from './components/GettingStarted/GettingsStarted'

class App extends React.Component {
  constructor(props) {
    super(props)
  }
  render() {
    return(
      <div>
        <BrowserRouter>
          <TopBar />
          <Switch>
            <Route exact path='/' component={LandingPage} />
            <Route path='/Holdings' component={Holdings} />
            <Route path='/test' component={Test} />
            <Route path='/test2' component={Test2} />
            <Route path='/test3' component={Test3} />
            <Route path='/test4' component={Test4} />
            <Route path='/ContactUs' component={ContactUs} />
            <Route path='/Can-I-Make-Money' component={MakeMoney} />
            <Route path='/FAQs' component={FAQs} />
            <Route path='/Getting-Started' component={GettingStarted} />
          </Switch>
          <HomeBar />
        </BrowserRouter>

      </div>
    )
  }
}

export default App;

const Test = () => {
  return(
    <div>test</div>
  )
}
const Test2 = () => {
  return(
    <div>test2</div>
  )
}
const Test3 = () => {
  return(
    <div>test3</div>
  )
}
const Test4 = () => {
  return(
    <div>test4</div>
  )
}
